import (
	context "context"
	rapiddocs "github.com/validation/rapiddocs"
	rapiddocsclient "github.com/validation/rapiddocs/client"
)

client := rapiddocsclient.NewClient()
response, err := client.Get(
	context.TODO(),
	&rapiddocs.GetRequest{
		Decimal: 2.2,
		Even:    100,
		Name:    "foo",
	},
)

